import * as React from 'react';
import { Text, View, FlatList } from 'react-native';
import calendar from '../components/calendar'
import progress from '../components/progress'

export default function HomeScreen() {
    return (
      <View style={{ flex: 0.5}}>
        {calendar}
        {progress}
      </View>
    );
  }
